import{_ as o,o as s,c as r,J as l,w as n,m as i,a as x,aa as c,E as a}from"./chunks/framework.DJCjJe2w.js";const d="/vite-press-blog/assets/status-code.BhJXNgFx.webp",N=JSON.parse('{"title":"http 状态码都有哪些","description":"","frontmatter":{"createTime":"2022/10/26","tag":"HTTP"},"headers":[],"relativePath":"basic-quality/http/status-code/index.md","filePath":"basic-quality/http/status-code/index.md","lastUpdated":1667989673000}'),h={name:"basic-quality/http/status-code/index.md"},_=i("h1",{id:"http-状态码都有哪些",tabindex:"-1"},[x("http 状态码都有哪些 "),i("a",{class:"header-anchor",href:"#http-状态码都有哪些","aria-label":'Permalink to "http 状态码都有哪些"'},"​")],-1),p=c('<h2 id="状态码第一位数字决定了不同的响应状态-如下" tabindex="-1">状态码第一位数字决定了不同的响应状态，如下 <a class="header-anchor" href="#状态码第一位数字决定了不同的响应状态-如下" aria-label="Permalink to &quot;状态码第一位数字决定了不同的响应状态，如下&quot;">​</a></h2><ul><li>1 表示消息</li><li>2 表示成功</li><li>3 表示重定向</li><li>4 表示请求错误</li><li>5 表示服务器错误</li></ul><h2 id="_1xx" tabindex="-1">1xx <a class="header-anchor" href="#_1xx" aria-label="Permalink to &quot;1xx&quot;">​</a></h2><p>代表请求已被接受，需要继续处理，这类响应是临时响应，只包含状态行和某些可选的响应信息，并一空行结束 常见的有：</p><ul><li>100 （客户继续发送请求，这是临时响应） 这个临时响应是用来通知客户端它的部分请求已经被服务器接收，且仍未被拒绝。客户端印当据需发送请求的剩余部分，或者如果请求已经完成，忽略这个响应，服务器必须在请求完成后向客户端发送一个最终响应</li><li>101 服务器根据客户端的请求切换协议，主要用于 websocket 或 HTTP2 升级</li></ul><h2 id="_2xx" tabindex="-1">2xx <a class="header-anchor" href="#_2xx" aria-label="Permalink to &quot;2xx&quot;">​</a></h2><p>代表请求已成功被服务器接收，处理，并接受</p><ul><li>200 （成功） 请求已成功，请求所希望的响应头或数据体将随此响应返回</li><li>201 （已创建）请求成功并且服务器创建了新的资源</li><li>202 （已创建）服务器已经接受请求，但尚未处理</li><li>203 （非授权信息）服务器已成功处理请求，但返回的信息可能来自另一来源</li><li>204 （无内容）服务器成功处理请求，但没有返回任何内容</li><li>205 （重置内容）服务器成功处理请求，但没有返回任何内容</li><li>206 （部分内容）服务器成功处理了部分请求</li></ul><h2 id="_3xx" tabindex="-1">3xx <a class="header-anchor" href="#_3xx" aria-label="Permalink to &quot;3xx&quot;">​</a></h2><p>表示要完成请求，需要进一步操作，通常这些状态代码用来重定向</p><ul><li>300 （多种选择）针对请求，服务器可执行多种操作。</li><li>301 （永久移动）请求的网页已永久移动到新位置。</li><li>302 （临时移动）服务器目前从不同位置的网页响应请求，但请求者应该继续使用原有位置来进行以后的请求</li><li>303 （查看其它位置）请求者应当对不同位置使用单独的 GET 请求来检索响应时，服务器返回此代码</li><li>305 （使用代理）请求者只能使用代理访问请求的网页。</li><li>307 （临时重定向）服务器目前从不同位置的网页响应请求，但请求者应继续使用原有位置来进行以后的请求</li></ul><h2 id="_4xx" tabindex="-1">4xx <a class="header-anchor" href="#_4xx" aria-label="Permalink to &quot;4xx&quot;">​</a></h2><p>代表了客户端看起来可能发生了错误，妨碍了服务器的处理</p><ul><li>400 （错误请求）服务器不理解请求的语法</li><li>401 （未授权）请求要求身份验证。</li><li>403 （禁止）服务器拒绝请求</li><li>404 （未找到）服务器找不到请求的网页</li><li>405 （方法禁用）禁用请求中指定的方法</li><li>406 （不接受）无法使用请求的内容特性响应请求的网页</li><li>407 （需要代理授权）此状态代码与 401（未授权）类似，但指定请求者应当授权使用代理</li><li>408 （请求超时）服务器等候请求时发生超时</li></ul><h2 id="_5xx" tabindex="-1">5xx <a class="header-anchor" href="#_5xx" aria-label="Permalink to &quot;5xx&quot;">​</a></h2><p>表示服务器无法完成明显有效的请求。这类状态代码代表了服务器在处理请求的过程中有错误或异常状态发生</p><ul><li>500 （服务器内部错误）服务器遇到错误，无法完成请求</li><li>501 （尚未实施）服务器服务器不具备完成请求的功能</li><li>502 （错误网关）服务器作为网关或代理，从上游服务器收到无效响应</li><li>503 （服务不可用）服务器目前无法使用，（由于超载或停机维护）</li><li>504 （网关超时）服务器作为网关或代理，但是没有及时从上游服务器收到请求</li><li>505 （ HTTP 版本不受支持）服务器不支持请求中所用的 HTTP 协议版本</li></ul><p><img src="'+d+'" alt="图片"></p>',18);function u(m,b,T,f,q,P){const t=a("ArticleMetadata"),e=a("ClientOnly");return s(),r("div",null,[_,l(e,null,{default:n(()=>[l(t)]),_:1}),p])}const C=o(h,[["render",u]]);export{N as __pageData,C as default};
